    numinroom: {
        height: "25px", 
        width: "84px", 
        backgroundColor: '#D8D8D8', 
        position: 'absolute', 
        marginTop: '28px', 
        marginLeft: '86px',
        borderRadius: '13px',
        fontSize: '13px',
        color: '#4A4A4A',
        fontWeight: '400',
        verticalAlign
    }
}));

